import { Github, LinkedIn } from '../assets/images';
import GalleryScroll from './GalleryScroll';
import './ProjectItem.css'
import MechButton from './components/MechButton';


function ProjectItem(props) {

    const { project, images} = props;

    return (
        <div className='project-item'>
            <h1>{project.title}</h1>
            <h4>{project.dates}</h4>
            <h5>
                <ul>
                    {project.details.map((item) => {
                        return (
                            <li style={{ padding: '5px' }}>{item}</li>
                        );
                    })}
                </ul>
            </h5>
            <div style={{display: 'flex'}}>
                <MechButton src={Github} url={"https://github.com/salsajeries"} alt={"github.com/salsajeries"} />
                <MechButton src={LinkedIn} url={"https://www.linkedin.com/in/salwa-jeries-17a146226/"} alt={"Salwa Jeries on Linkedin"} />
            </div>
            {images.size !== 0 ? (
                <GalleryScroll images={images}></GalleryScroll>
            ) : (
                <></>
            )}
        </div>
    );
}

export default ProjectItem;
